function Task(tasks) {
  const [task, setTask] = useState(tasks);
  console.log(task)



  return (
    <div className="task">
      <div className="label">{task.category}</div>
      <div className="text">{task.text}</div>
      <button className="delete" onClick={() => {setTask(task.filter(x =>
        x.text !== x.text))}}>X</button>
    </div>
  );
}

export default Task;
